(56, 1, '2021-08-13 12:08:41', '2021-08-13 12:08:41', '<strong data-spm-anchor-id=\"a2a0e.pdp.product_detail.i0.415b7c48lxcYmC\">Save Battery:</strong>\r\n<div>Charging time: 2 hours</div>\r\n<div>Lighting time: 6 hours</div>\r\n<div>Play time : 6 hours</div>\r\n<div>Night Light also supports USB, Micro SD card, 3.5mm Line-In audio input. Use the cable provided for even longer audio playback time.</div>\r\n<div>It has a Built-In Mic which supports excellent handsfree capability because of the noise cancellation software.</div>\r\n<div><strong>Speaker Phone:</strong></div>\r\n<div>Night light Bluetooth speaker is compatible with all Bluetooth devices. And quality speaker driver had been specially selected to provide the most soothing audio experience.</div>\r\n<div><strong>Soothing Audio:</strong></div>\r\n<div>You can also turn off the light, just go to Ambient mode and simple tap until light is off.</div>\r\n<div>In Color mode, tap for 7 color changes, including LED lights reacting slow &amp; fast to the beat of your music.</div>\r\n<div>In Ambient mode, tap for 3 levels of brightness.</div>\r\n<div>Tap and hold speaker mesh to change between Ambient &amp; Color modes.</div>\r\n<div>In Ambient mode, tap for 3 levels of brightness.</div>\r\n<div data-spm-anchor-id=\"a2a0e.pdp.product_detail.i4.415b7c48lxcYmC\">In Color mode, tap for 7 color changes, including LED lights reacting slow &amp; fast to the beat of your music.</div>\r\n<div data-spm-anchor-id=\"a2a0e.pdp.product_detail.i5.415b7c48lxcYmC\">You can also turn off the light, just go to Ambient mode and simple tap until light is off.</div>', 'Lamp Light with Speaker Wireless Portable Bluetooth Touch Color Control LED Lamp Speaker', '<ul class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i7.415b7c48lxcYmC\">\r\n 	<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i8.415b7c48lxcYmC\">♫: 4 IN ONE Multifunctional LED night light</li>\r\n 	<li class=\"\">♫: Bedside Lamp Touch + Speaker Bluetooth 4.0 +Pass Calls, bedside lamp compatible with any Bluetooth device: Android, IOS, Tablet, MacBook etc ... up to at 10 meters distance.</li>\r\n 	<li class=\"\">♫: Multicolor Table Lamp Mode</li>\r\n 	<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i6.415b7c48lxcYmC\">♫: Touchscreen Bluetooth Bedside Lamp Control 3 Lighting Modes: White Light (3 Levels: Low, Normal and High), 7 Color RGB Change, LED Night Light Multicolor Flashing.</li>\r\n 	<li class=\"\">The Bluetooth speaker automatically reconnects to the last device used, and the bluetooth lamp turns on and off by touching the upper mesh to change the color of the lights</li>\r\n 	<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i9.415b7c48lxcYmC\">♫: There is a hook at the bottom of the touch led bedside lamp, the manual in French, easy to carry</li>\r\n</ul>', 'publish', 'open', 'closed', '', 'lamp-light-speaker', '', '', '2021-11-13 10:28:08', '2021-11-13 10:28:08', '', 0, 'http://localhost/syed_variety_zone/?post_type=product&#038;p=56', 0, 'product', '', 0),
